nterference with custody, gross abuse of a corpse, and four counts of felonious assault.\\n\\nProblems stemmed right from Dylan’s day of birth on January 10, 2019. The boy was born with drugs in his system, authorities claim. Daniel Groves later got the child back after showing that he followed regulations, but the defendant allegedly started missing important dates, including court dates and doctor’s appointments.\\n\\nInvestigators claim that both defendants bolted on a four-wheeler when authorities dropped by the home for a checkup on May 20, according to WLTW. Deputies obtained a search warrant, got Jessica Groves to give herself up quickly, but Daniel Groves was only arrested after a six-hour standoff. Authorities said they found $42,000 of stolen items at the residence, and later found the late infant in a well.\\n\\nDeputies said Dylan Groves didn’t even make it to a full three months of age. They claim there’s evidence showing he’d been dead since March.\\n\\nA coroner determined that the victim had been slain. The child sustained several bone fractures, had been wrapped in plastic bags with duct tape, then put in milk crates that were wrapped in chains, and other bindings, according to WSAZ. The creates were weighted down with rocks and a weight, authorities said. As in his birth, Groves died with drugs in his body, according to the coroner. This allegedly included methamphetamine.\\n\\n#DylanGroves #GrovesTrial #JessicaAndDanielGrovesTrial\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/C_PsrXRF0Wk\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBxtQIb_cM6e3aLq2DAKkt8-MiShA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/C_PsrXRF0Wk\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLA5rr_0WRj6qhq8508_N9eqg59ZPQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/C_PsrXRF0Wk\/hqdefault.jpg?sqp= e boy’s parents–mother Jessica Groves, and father Daniel Groves–for what happened. The defendants are charged with aggravated murder, murder, kidnapping, endangering children, tampering with evidence, interference with custody, gross abuse of a corpse, and four counts of felonious assault.\\n\\nProblems stemmed right from Dylan’s day of birth on January 10, 2019. The boy was born with drugs in his system, authorities claim. Daniel Groves later got the child back after showing that he followed regulations, but the defendant allegedly started missing important dates, including court dates and doctor’s appointments.\\n\\nInvestigators claim that both defendants bolted on a four-wheeler when authorities dropped by the home for a checkup on May 20, according to WLTW. Deputies obtained a search warrant, got Jessica Groves to give herself up quickly, but Daniel Groves was only arrested after a six-hour standoff. Authorities said they found $42,000 of stolen items at the residence, and later found the late infant in a well.\\n\\nDeputies said Dylan Groves didn’t even make it to a full three months of age. They claim there’s evidence showing he’d been dead since March.\\n\\nA coroner determined that the victim had been slain. The child sustained several bone fractures, had been wrapped in plastic bags with duct tape, then put in milk crates that were wrapped in chains, and other bindings, according to WSAZ. The creates were weighted down with rocks and a weight, authorities said. As in his birth, Groves died with drugs in his body, according to the coroner. This allegedly included methamphetamine.\\n\\n#DylanGroves #GrovesTrial #JessicaAndDanielGrovesTrial\"},\"lengthSeconds\":\"3148\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCz8K1occVvDTYDfFo7N5EZw\",\"externalChannelId\":\"UCz8K1occVvDTYDfFo7N5EZw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\ cording to WLTW. Deputies obtained a search warrant, got Jessica Groves to give herself up quickly, but Daniel Groves was only arrested after a six-hour standoff. Authorities said they found $42,000 of stolen items at the residence, and later found the late infant in a well.\n\nDeputies said Dylan Groves didn’t even make it to a full three months of age. They claim there’s evidence showing he’d been dead since March.\n\nA coroner determined that the victim had been slain. The child sustained several bone fractures, had been wrapped in plastic bags with duct tape, then put in milk crates that were wrapped in chains, and other bindings, according to WSAZ. The creates were weighted down with rocks and a weight, authorities said. As in his birth, Groves died with drugs in his body, according to the coroner. This allegedly included methamphetamine.\n\n"},{"text":"#DylanGroves","navigationEndpoint":{"clickTrackingParams":"CJcBENzXBCITCLypw4fOnOoCFYMR8QUd78MNZQ==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23DylanGroves","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#DylanGroves"}},"loggingDirectives":{"trackingParams":"CJcBENzXBCITCLypw4fOnOoCFYMR8QUd78MNZQ==","visibility":{"types":"12"}}},{"text":" "},{"text":"#GrovesTrial","navigationEndpoint":{"clickTrackingParams":"CJYBENzXBCITCLypw4fOnOoCFYMR8QUd78MNZQ==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23GrovesTrial","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#GrovesTrial"}},"loggingDirectives":{"trackingParams":"CJYBENzXBCITCLypw4fOnOoCFYMR8QUd78MNZQ==","visibility":{"types":"12"}}},{"text":" "},{"text":"#JessicaAndDanielGrovesTrial","navigationEndpoint":{"clickTrackingParams":"CJUBENzXBCITCLypw4fOnOoCFYMR8QUd78MNZQ==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23JessicaAndDanielGrovesTrial","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query"  down a well last year, prosecutors said. Authorities blame the boy’s parents–mother Jessica Groves, and father Daniel Groves–for what happened. The defendants are charged with aggravated murder, murder, kidnapping, endangering children, tampering with evidence, interference with custody, gross abuse of a corpse, and four counts of felonious assault.\n\nProblems stemmed right from Dylan’s day of birth on January 10, 2019. The boy was born with drugs in his system, authorities claim. Daniel Groves later got the child back after showing that he followed regulations, but the defendant allegedly started missing important dates, including court dates and doctor’s appointments.\n\nInvestigators claim that both defendants bolted on a four-wheeler when authorities dropped by the home for a checkup on May 20, according to WLTW. Deputies obtained a search warrant, got Jessica Groves to give herself up quickly, but Daniel Groves was only arrested after a six-hour standoff. Authorities said they found $42,000 of stolen items at the residence, and later found the late infant in a well.\n\nDeputies said Dylan Groves didn’t even make it to a full three months of age. They claim there’s evidence showing he’d been dead since March.\n\nA coroner determined that the victim had been slain. The child sustained several bone fractures, had been wrapped in plastic bags with duct tape, then put in milk crates that were wrapped in chains, and other bindings, according to WSAZ. The creates were weighted down with rocks and a weight, authorities said. As in his birth, Groves died with drugs in his body, according to the coroner. This allegedly included methamphetamine.\n\n#DylanGroves #GrovesTrial #JessicaAndDanielGrovesTrial","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/C_PsrXRF0Wk/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBxtQIb_cM6e3aLq2DAKkt8-MiShA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/C_PsrXR escription":{"simpleText":"A mother and father in Scioto County, Ohio stand trial in the death of their infant son. Young Dylan Groves was found dead 30 feet down a well last year, prosecutors said. Authorities blame the boy’s parents–mother Jessica Groves, and father Daniel Groves–for what happened. The defendants are charged with aggravated murder, murder, kidnapping, endangering children, tampering with evidence, interference with custody, gross abuse of a corpse, and four counts of felonious assault.\n\nProblems stemmed right from Dylan’s day of birth on January 10, 2019. The boy was born with drugs in his system, authorities claim. Daniel Groves later got the child back after showing that he followed regulations, but the defendant allegedly started missing important dates, including court dates and doctor’s appointments.\n\nInvestigators claim that both defendants bolted on a four-wheeler when authorities dropped by the home for a checkup on May 20, according to WLTW. Deputies obtained a search warrant, got Jessica Groves to give herself up quickly, but Daniel Groves was only arrested after a six-hour standoff. Authorities said they found $42,000 of stolen items at the residence, and later found the late infant in a well.\n\nDeputies said Dylan Groves didn’t even make it to a full three months of age. They claim there’s evidence showing he’d been dead since March.\n\nA coroner determined that the victim had been slain. The child sustained several bone fractures, had been wrapped in plastic bags with duct tape, then put in milk crates that were wrapped in chains, and other bindings, according to WSAZ. The creates were weighted down with rocks and a weight, authorities said. As in his birth, Groves died with drugs in his body, according to the coroner. This allegedly included methamphetamine.\n\n#DylanGroves #GrovesTrial #JessicaAndDanielGrovesTrial"},"lengthSeconds":"3148","ownerProfileUrl":"http://www.youtube.com/channel/UCz8K1occVvDTYDfFo7N5EZw","externalChann
